import React, { useEffect, useState } from 'react'
import { View, Text, Button} from 'react-native'
import { useNavigation } from '@react-navigation/native';
import ApiService from '../ApiService';
import SingleEventScreen from '../screens/SingleEventScreen';



interface EventListScreenProps {
  user: string
}


export default function EventListScreen(props:any) {

  const [myEvents, setMyEvents] = useState([])


  const navigation = useNavigation();

  useEffect(() => {
    const currentUser = {user: props.route.params.user}
    // console.log(props)
    // console.log(currentUser)
    ApiService.getEventsList(currentUser)
    .then(events => setMyEvents(events))
    .catch(err => console.log(err))
  },[],
  )

  console.log


  let attendedEvents = myEvents.map((event: any) =>
  {
    return <View key={event._id}>
    <Text>
      {event.eventName}
    </Text>
    <Button
      color='blue'
      title='Go to Event'
      onPress={() => {
        navigation.navigate('SingleEventScreen', {
          eventId: event._id
        })
        }} />
     </View>
  }
)

  return (
    <View>
      <View>
        {attendedEvents ? attendedEvents: <Text>Hi</Text>}
        </View>
      <Text>Hi</Text>
    </View>
  )
}
